"attributes":{},"id":"64860","type":"BasicTicker"},{"attributes":{},"id":"65484","type":"Selection"},{"attributes":{},"id":"64857","type":"LinearScale"},{"attributes":{"axis":{"id":"64859"},"coordinates":null,"group":null,"ticker":null},"id":"64862","type":"Grid"},{"attributes":{"axis_label":"Width, W (m)","coordinates":null,"formatter":{"id":"64907"},"group":null,"major_label_policy":{"id":"64908"},"ticker":{"id":"64860"}},"id":"64859","type":"LinearAxis"},{"attributes":{},"id":"65485","type":"StringEditor"},{"attributes":{"children":[{"id":"64828"},{"id":"64829"}]},"id":"64830","type":"Row"},{"attributes":{"tools":[{"id":"64867"},{"id":"64868"},{"id":"64869"},{"id":"64870"},{"id":"64914"}]},"id":"64872","type":"Toolbar"},{"attributes":{"coordinates":null,"data_source":{"id":"64723"},"glyph":{"id":"64808"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"64810"},"nonselection_glyph":{"id":"64809"},"view":{"id":"64812"}},"id":"64811","type":"GlyphRenderer"},{"attributes":{},"id":"65486","type":"StringEditor"},{"attributes":{"text":"&lt;h1&gt;Overland (laminar) flow equations&lt;/h1&gt;\n        &lt;p style=\"color:red; font-size: 150%\"&gt;Under construction&lt;/p&gt;\n        &lt;p&gt;This applet applies the steady, uniform flow equation to the case of laminar, overland flow&lt;/p&gt;\n        "},"id":"64822","type":"Div"},{"attributes":{"text":"&lt;h2&gt;User Input Controls&lt;/h2&gt;"},"id":"64827","type":"Div"},{"attributes":{"children":[{"id":"64824"},{"id":"64727"}],"width":350},"id":"64829","type":"Column"},{"attributes":{"sizing_mode":"stretch_width","text":"\n        &lt;h2&gt;Background&lt;/h2&gt;\n        \n        &lt;h3&gt;Steady, uniform flow equation&lt;/h3&gt;\n        &lt;p&gt;Under the assumptions of &lt;u&gt;&lt;b&gt;steady, uniform&lt;/b&gt;&lt;/u&gt; flow, application of Newton's 2nd law $$\\left(\\sum F = 0 \\right)$$ to a surface flow system leads to the following equation for the mean flow velocity, &lt;br&gt;\n            $$\\quad V = \\sqrt{\\frac{2g}{C_D}R\\sin{\\theta}} $$ &lt;br&gt;\n            where &lt;br&gt;\n            $$\\qquad R = \\frac{A}{P} $$ is the hydraulic radius $$[L]$$ with $$A$$ the flow cross-sectional area $$[L^2]$$ and $$P$$ the wetted perimeter $$[L]$$. &lt;br&gt;\n            $$\\qquad \\theta$$ is the angle of the overland slope &lt;br&gt;\n            $$\\qquad g = 9.81 m/s^2$$ is the acceleration due to gravity &lt;br&gt;\n            $$\\qquad C_D$$ is the drag coeficient.\n        &lt;/p&gt;\n        \n        &lt;h3&gt;Application to (laminar) overland flow&lt;/h3&gt;\n        \n        &lt;p&gt;For laminar flow, the drag coefficient is given by, &lt;br&gt;\n            $$\\quad C_D = \\frac{24}{Re}$$ &lt;br&gt;\n            where &lt;br&gt;\n            $$\\qquad Re = \\frac{4VD}{\\nu}$$ is the Reynolds number with $$D$$ the mean flow depth and $$\\nu \\left(\\approx 10^{-6} m^2/s \\right)$$ the kinemetic viscosity of water. &lt;br&gt;\n        &lt;/p&gt;\n        &lt;p&gt;Inserting $$C_D$$ into $$V$$ yields the steady, uniform flow equation for the mean flow velocity, &lt;br&gt;\n            $$\\quad V = \\frac{gD^2\\sin{\\theta}}{3\\nu}$$&lt;br&gt;\n            which has two unkowns, $$V$$ and $$D$$. Therefore, a second equation relating these two unkowns is required.\n        &lt;/p&gt;\n        \n        &lt;h3&gt;Conservation of mass&lt;/h3&gt;\n        &lt;p&gt;Application of the conservation of mass principle to a steady, overland flow system yields, &lt;br&gt;\n            $$\\quad q = \\left(i-f\\right)L\\cos{\\theta}$$ &lt;br&gt;\n            where &lt;br&gt;\n            $$\\qquad q = VD$$ is the unit discharge, or flow per unit width $$Q/W$$ $$[L^2/T]$$&lt;br&gt;\n            $$\\qquad i$$ is the rainfall rate $$[L/T]$$&lt;br&gt;\n            $$\\qquad f$$ is the infiltration rate $$[L/T]$$&lt;br&gt;\n            $$\\qquad L$$ is the overland slope length $$[L]$$&lt;br&gt;\n        &lt;/p&gt;\n        \n        &lt;h3&gt;Overland flow equations&lt;/h3&gt;\n        &lt;p&gt;Combing the steady, uniform flow equation (Newton's 2nd law) for $$V$$ with the conservation of mass equation for $$q\\left(=VD\\right)$$ yields the following expression for the mean flow depth, &lt;br&gt;\n            $$\\quad D = \\left(\\frac{3\\nu q}{g \\sin{\\theta}}\\right)^{1/3}$$\n        &lt;/p&gt;\n                    ","width":400},"id":"64823","type":"Div"},{"attributes":{},"id":"65487","type":"UnionRenderers"},{"attributes":{},"id":"65488","type":"Selection"},{"attributes":{"child":{"id":"64834"},"title":"Overland Flow"},"id":"64835","type":"Panel"},{"attributes":{"line_width":4,"x":{"field":"x"},"y":{"field":"wall"}},"id":"64878","type":"Line"},{"attributes":{"axis_label":"Depth, D (m)","coordinates":null,"formatter":{"id":"64904"},"group":null,"major_label_policy":{"id":"64905"},"ticker":{"id":"64864"}},"id":"64863","type":"LinearAxis"},{"attributes":{},"id":"64851","type":"DataRange1d"},{"attributes":{"children":[{"id":"64831"}],"height":750},"id":"64832","type":"Row"},{"attributes":{},"id":"64853","type":"DataRange1d"},{"attributes":{"fill_alpha":{"value":0.1},"fill_color":{"field":"color"},"hatch_alpha":{"value":0.1},"line_alpha":{"value":0.1},"marker":{"value":"circle_dot"},"size":{"value":8},"x":{"field":"x"},"y":{"field":"zD"}},"id":"64809","type":"Scatter"},{"attributes":{"button_type":"success","icon":null,"js_event_callbacks":{"button_click":[{"id":"64821"}]},"label":"Click to Restore Defaults","width":100},"id":"64820","type":"Button"},{"attributes":{"children":[{"id":"64832"},{"id":"64833"},{"id":"64825"}]},"id":"64834","type":"Column"},{"attributes":{"coordinates":null,"group":null,"source":{"id":"64723"},"text":{"field":"legend_label"},"text_color":{"field":"color"},"text_font_size":{"value":"12px"},"x":{"field":"x"},"x_offset":{"value":5},"y":{"field":"zD"},"y_offset":{"value":5}},"id":"64813","type":"LabelSet"},{"attributes":{"args":{"slider_L":{"id":"64720"},"slider_S":{"id":"64721"},"slider_f":{"id":"64719"},"slid nst theta_i = InitialMoisture_slider.value;\n                                const time = Time_slider.value;\n\n                                // Declare variables //////////////////////////\n                                var dTheta, Ns, tp, Fp, F, fc, f, r, L, count, I, R, Fold, dF, Fnew, count\n\n                                // calcs //////////////////////////////////////\n                                function getInfiltrationParameters(n,psi,Ks,rain,theta_i,time) {\n\n                                    // constants\n                                    dTheta = n - theta_i/100\n                                    Ns = dTheta*psi\n                                    \n                                    // G&amp;A F solver function\n                                    function getF(Fp,Ks,tp,time) {\n                                         Fold = Fp + Ks*(time-tp) \n                                         const tol = 10**-10\n                                         dF = tol + 1\n                                         count = 0\n                                         while (dF &gt;= tol) {\n                                             Fnew = Fp + Ks*(time - tp) + Ns*Math.log((Ns + Fold)/(Ns + Fp))\n                                             dF = Math.abs(Fnew - Fold)\n                                             Fold = Fnew\n                                             count = count + 1\n                                             }\n                                         return [Fnew, count]\n                                         }\n                                    \n                                    // physical logic ...\n                                    I = rain*time\n                                    if (rain &lt; Ks) { // ponding never occurs\n                                        // get fc                                                    \n                                        tp = 0;\n                                        Fp = 0;\n                                        let Fcalc = getF(Fp,Ks,tp,time)\n                                        fc = Ks*(1 + Ns/Fcalc[0]);\n                                        // for table\n                                        tp = NaN; \n                                        Fp = NaN;\n                                        F = rain*time;\n                                        r = 0;\n                                        R = 0;\n                                        count = NaN;\n                                        f = rain;\n                                        } \n                                    else { // ponding occurs at some stage\n                                        tp = Ns*Ks/(rain*(rain - Ks));\n                                        if (time &lt; tp) { // pre ponding\n                                            Fp = rain*time;\n                                            R = 0;\n                                            F = rain*time;\n                                            fc = Ks*(1+Ns/F);\n                                            f = rain;\n                                            r = 0;\n                                            count = NaN;\n                                                      }\n                                        else{ // post ponding\n                                            Fp = rain*tp\n                                            let Fcalc = getF(Fp,Ks,tp,time)\n                                            F = Fcalc[0];\n                                            fc = Ks*(1+Ns/F);\n                                            count = Fcalc[1];\n                                            R = I - F\n                                            f = fc\n                                            r = rain - f\n                                             }\n                                        }\n                                    L = F/dTheta\n                                    return [dTheta, Ns, tp, Fp, F, count, L, I, R, fc, f, r];\n                                    }                                    \n \n                                // update table source data ///////////////////\n                                let InfiltrationParameters = getInfiltrationParameters(n,psi,Ks,rain,theta_i,time)\n                                sourceInfiltrationParameterTable.data['Value'][0] = dTheta.toFixed(3); \n                                sourceInfiltrationParameterTable.data['Value'][1] = Ns.toFixed(3);\n                                if (isNaN(tp)) {\n                                        sourceInfiltrationParameterTable.data['Value'][2] = 'No ponding'\n                                        sourceInfiltrationParameterTable.data['Value'][3] = 'No ponding';\n                                        sourceInfiltrationParameterTable.data['Value'][5] = 'No ponding';\n                                        }\n                                else {\n                                    sourceInfiltrationParameterTable.data['Value'][2] = tp.toFixed(3);\n                                    sourceInfiltrationParameterTable.data['Value'][3] = Fp.toFixed(3);\n                                    sourceInfiltrationParameterTable.data['Value'][5] = count.toFixed(0);\n                                    }\n                                sourceInfiltrationParameterTable.data['Value'][4] = F.toFixed(3);\n                                sourceInfiltrationParameterTable.data['Value'][6] = L.toFixed(3);\n                                sourceInfiltrationParameterTable.data['Value'][7] = I.toFixed(3);\n                                sourceInfiltrationParameterTable.data['Value'][8] = R.toFixed(3);\n                                sourceInfiltrationParameterTable.data['Value'][9] = fc.toFixed(3);\n                                sourceInfiltrationParameterTable.data['Value'][10] = f.toFixed(3);\n                                sourceInfiltrationParameterTable.data['Value'][11] = r.toFixed(3);\n                                sourceInfiltrationParameterTable.change.emit();\n                                \n                                // upodated plot slider points ////////////////\n                                sourcePlotSlider_TS.data['xPoint'][0] = time;\n                                sourcePlotSlider_TS.data['xPoint'][1] = time;\n                                sourcePlotSlider_TS.data['xPoint'][2] = time;\n                                sourcePlotSlider_TS.data['xPoint'][3] = time;\n                                sourcePlotSlider_TS.data['yPoint'][0] = rain;\n                                sourcePlotSlider_TS.data['yPoint'][1] = fc;\n                                sourcePlotSlider_TS.data['yPoint'][2] = f;\n                                sourcePlotSlider_TS.data['yPoint'][3] = r;\n                                sourcePlotSlider_TS.change.emit();\n\n                                // update ponding time line and label\n                                sourcePondingTime.data['xAxis'][0] = tp;\n                                sourcePondingTime.data['xAxis'][1] = tp;\n                                sourcePondingTime.data['yAxis'][1] = rain;\n                                sourcePondingTime.change.emit()\n                                \n                                // timeseries profile update //////////////////\n                                const dataProfile_TS = sourceProfile_TS.data;\n                                const time_TS = dataProfile_TS['xProfile'];\n                                const i_TS = dataProfile_TS['i'];\n                                const fc_TS = dataProfile_TS['fc'];\n                                const f_TS = dataProfile_TS['f'];\n                                const r_TS = dataProfile_TS['r'];\n                                for (let ii = 0; ii &lt; time_TS.length; ii++) {\n                                        let InfiltrationParameters = getInfiltrationParameters(n,psi,Ks,rain,theta_i,time_TS[ii])\n                                        i_TS[ii] = rain\n                                        fc_TS[ii] = InfiltrationParameters[9]\n                                        f_TS[ii] = InfiltrationParameters[10]\n                                        r_TS[ii] = InfiltrationParameters[11]\n                                        }\n                                sourceProfile_TS.change.emit();\n                                \n                                // shading plot update ////////////////////////\n                                var time_shading = -0.01;\n                                var ii = 0;\n                                const xout = Array();\n                                var Fout = Array();\n                                var Rout = Array();\n                                var index = Array();\n                                var zeros = Array();\n                                while (time_shading &lt; time) {\n                                    let InfiltrationParameters = getInfiltrationParameters(n,psi,Ks,rain,theta_i,time_shading)\n                                    time_shading = time_shading + 0.01;\n                                    xout[ii] = time_shading;\n                                    Fout[ii] = f;\n                                    Rout[ii] = rain;\n                                    index[ii] = ii;\n                                    zeros[ii] = 0;\n                                    ii = ii + 1;\n                                    }\n\n                                source_Shading.data['index'] = index.concat(index);\n                                const xout_norm = [...xout];\n                                const xout_rev = [...xout.reverse()];\n                                source_Shading.data['x'] = xout_norm.concat(xout_rev);\n                                \n                                const Fout_rev = [...Fout.reverse()];\n                                const Fout_norm = [...Fout];\n                                source_Shading.data['F'] = zeros.concat(Fout_rev);\n                                \n                                source_Shading.data['R'] = Rout.concat(Fout_norm);\n                                source_Shading.change.emit();\n                                \n                                "},"id":"64701","type":"CustomJS"},{"attributes":{"bottom_units":"screen","coordinates":null,"fill_alpha":0.5,"fill_color":"lightgrey","group":null,"left_units":"screen","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"right_units":"screen","syncable":false,"top_units":"screen"},"id":"64181","type":"BoxAnnotation"},{"attributes":{"fill_alpha":{"value":0.2},"fill_color":{"value":"black"},"hatch_alpha":{"value":0.2},"line_alpha":{"value":0.2},"marker":{"value":"circle_dot"},"size":{"value":15},"x":{"field":"x"},"y":{"field":"datum"}},"id":"64402","type":"Scatter"},{"attributes":{"axis_label":"z (m)","coordinates":null,"formatter":{"id":"64258"},"group":null,"major_label_policy":{"id":"64259"},"ticker":{"id":"64174"}},"id":"64173","type":"LinearAxis"},{"attributes":{"text":"&lt;h1&gt;Groundwater: Darcy's Law (Saturated zone flow) &lt;/h1&gt;\n        &lt;p&gt;\n            This example examines &lt;u&gt;&lt;b&gt;horizontal&lt;/b&gt;&lt;/u&gt;, saturated zone flow in an unconfined aquifer between two piezometers (wells) that are $$L$$ metres apart.\n        &lt;/p&gt;\n                                      \n        "},"id":"64327","type":"Div"},{"attributes":{"overlay":{"id":"64181"}},"id":"64177","type":"BoxSelectTool"},{"attributes":{"children":[{"id":"64330"},{"id":"64157"}],"width":350},"id":"64335","type":"Column"},{"attributes":{"children":[{"id":"64160"}]},"id":"64336","type":"Column"},{"attributes":{"data":{"index":[0,1],"x":{"__ndarray__":"AAAAAAAABMABAAAAAIA7QA==","dtype":"float64","order":"little","shape":[2]},"y1":[0,0],"y2":{"__ndarra ":0.2,"step":0.1,"title":"Pressure head at (2), ph2 (m)","value":1.0},"id":"64152","type":"Slider"},{"attributes":{"height":5,"style":{"font-size":"80%"},"text":"&lt;p&gt;&lt;img src=\"images/copyright-symbol.png\" alt=\"Copyright\" width=\"10\"&gt; 2022, Dr Nick Cartwright, Griffith University&lt;/p&gt;"},"id":"64331","type":"Div"},{"attributes":{"tools":[{"id":"64177"},{"id":"64178"},{"id":"64179"},{"id":"64180"}]},"id":"64182","type":"Toolbar"},{"attributes":{"sizing_mode":"stretch_width","text":"&lt;h2&gt;Background&lt;/h2&gt;\n        &lt;h3&gt;The saturated zone&lt;/h3&gt;\n        &lt;p&gt;The saturated zone is where the pore space is completely full (saturated) with water. \n            In an unconfined aquifer system, the upper bound of the saturated zone is known as the water table (or phreatic surface) which is defined as the surface where the pore water pressure is equal to atmospheric pressure ($$p=0$$).   \n        &lt;/p&gt;\n\n        &lt;h3&gt;Darcy's law: The Darcy flux&lt;/h3&gt;\n        &lt;p&gt;The flow of groundwater is governed by Darcy's law which states that the flow rate is proportional to the driving piezometric head gradient and the hydrualic conductivity. That is, &lt;br&gt;\n            $$\\quad q = -K\\nabla h \\quad [L/T]$$ &lt;br&gt;\n            where \n            $$q$$ is known as Darcy's flux which represents the flow per unit area $$\\left(Q/A\\right)$$, \n            $$K$$ is the hydraulic conductivity $$[L/T]$$ and &lt;br&gt;\n            $$\\quad \\nabla h = \\left( \\frac{\\partial h}{\\partial x} + \\frac{\\partial h}{\\partial y} + \\frac{\\partial h}{\\partial z} \\right) $$ is the piezometric head gradient. \n        &lt;/p&gt;\n\n        &lt;p&gt;\n            The piezometric head represents the potential energy of the (ground)water and is given by, &lt;br&gt;\n            $$\\quad h = z+\\frac{p}{\\rho g} \\quad [L]$$ &lt;br&gt;\n            where $$z$$ the elevation head (the height of the measuring point above the datum, $$z=0$$) and \n            $$\\frac{p}{\\rho g} $$ is the pressure head (the height of water above the measurement point),\n            $$p$$ is the pore water pressure, $$\\rho $$ is the density of water and $$g = 9.81m/s^2$$ is the acceleration due to gravity.\n        &lt;/p&gt;\n\n        &lt;h3&gt;Darcy's law: Horizontal flow&lt;/h3&gt;\n        &lt;p&gt;For the case of purely horizontal flow in the $$x$$ direction Darcy's law becomes,&lt;br&gt;\n            $$\\quad q = -K\\frac{\\partial h}{\\partial x}$$ &lt;br&gt;\n            which can be evaluated using the finite difference appoximation of the gradient term, that is, &lt;br&gt;\n            $$\\quad q = -K\\frac{\\partial h}{\\partial x} \\approx -K\\frac{\\Delta h}{\\Delta x} = -K\\frac{h_2-h_1}{x_2-x_1}  = -K\\frac{h_1-h_2}{x_1-x_2}  $$ &lt;br&gt;\n        &lt;/p&gt;\n\n        &lt;h3&gt;Seepage velocity&lt;/h3&gt;\n        &lt;p&gt;The seepage velocity $$V$$ accounts for the fact that not all of the flow cross-sectional area $$A$$ is available for flow due to the presence of sediments. \n            The actual area available is $$A_{actual}=An_e$$ since $$n_e$$ represents the void space available for flow hence the adjusted Darcy flux (the seepage velocity) given by, &lt;br&gt;\n            $$\\quad V = \\frac{Q}{A_{actual}} = \\frac{Q}{An_e} = \\frac{q}{n_e}$$\n        &lt;/p&gt;\n                    ","width":400},"id":"64328","type":"Div"},{"attributes":{"editor":{"id":"65619"},"field":"Parameter","formatter":{"id":"65618"},"title":"Parameter"},"id":"64144","type":"TableColumn"},{"attributes":{"children":[{"id":"63766"}],"sizing_mode":"stretch_both"},"id":"63769","type":"Column"},{"attributes":{"children":[{"id":"64338"}]},"id":"64339","type":"Row"},{"attributes":{"args":{"slider_L":{"id":"64153"},"slider_ph1":{"id":"64151"},"slider_ph2":{"id":"64152"},"slider_z1":{"id":"64149"},"slider_z2":{"id":"64150"},"sourceSoilProperties_ALL":{"id":"64141"},"sourceSoilProperties_SELECTED":{"id":"64142"},"source_Fill":{"id":"64187"},"source_Labels":{"id":"64282"},"source_OutputTable":{"id":"64154"},"source_Plot_Lines":{"id":"64242"},"source_Plot_Scatter":{"id":"64313"},"source_Well1":{"id":"64200"},"source_Well1_Air":{"id":"64214"},"source_Well1_Water":{"id":"64207"},"source_Well2":{"id":"64221"},"source_Well2_Air":{"id":"64235"},"source_Well2_Water":{"id":"64228"},"source_ph1":{"id":"64299"},"source_ph2":{"id":"64306"},"source_z1":{"id":"64285"},"source_z2":{"id":"64292"}},"code":"\n                                 \n                                 // get slider values /////////////////////\n                                 const z1 = slider_z1.value;\n                                 const z2 = slider_z2.value;\n                                 const ph1 = slider_ph1.value;\n                                 const ph2 = slider_ph2.value;\n                                 const L = slider_L.value;\n                                 \n                                 var K = sourceSoilProperties_SELECTED.data['ParameterValue'][1]/100/3600 // m/s\n                                 var ne = sourceSoilProperties_SELECTED.data['ParameterValue'][0]\n\n                                 // do calcs\n                                 const h1 = z1 + ph1\n                                 const h2 = z2 + ph2\n                                 const dh = h2-h1\n                                 const dhdx = (h2-h1)/L\n                                 const q = -K*dhdx  //m/s\n                                 const V = q*24*3600/ne // m/d\n                                 \n                                 // update source data table\n                                 source_OutputTable.data['Value'][0] = h1.toFixed(2);\n                                 source_OutputTable.data['Value'][1] = h2.toFixed(2);\n                                 source_OutputTable.data['Value'][2] = dh.toFixed(2);\n                                 source_OutputTable.data['Value'][3] = dhdx.toExponential(3);\n                                 const qmday = q*24*3600 // m/day\n                                 source_OutputTable.data['Value'][4] = q.toExponential(3);\n                                 source_OutputTable.data['Value'][5] = qmday.toExponential(3);\n                                 source_OutputTable.data['Value'][6] = V.toExponential(3);\n                                 source_OutputTable.change.emit()\n                                 \n                                 // update plot source\n                                 source_Plot_Lines.data['x'] = [0, L]\n                                 source_Plot_Lines.data['z'] = [z1, z2]\n                                 source_Plot_Lines.data['ph'] = [ph1, ph2]\n                                 source_Plot_Lines.data['h'] = [h1, h2]\n                                 source_Plot_Lines.change.emit()\n                                 \n                                 // update lines /////////////////////////////\n                                 source_z1.data['y'] = [0,z1];\n                                 source_z1.change.emit();\n                                 \n                                 source_z2.data['x'] = [L,L];\n                                 source_z2.data['y'] = [0,z2];\n                                 source_z2.change.emit();\n                                 \n                                 source_ph1.data['y'] = [z1,h1];\n                                 source_ph1.change.emit();\n                                 \n                                 source_ph2.data['x'] = [L,L];\n                                 source_ph2.data['y'] = [z2,h2];\n                                 source_ph2.change.emit();\n\n                                 // update scatter\n                                 source_Plot_Scatter.data['x'] = [0, L, 0, L, 0, L];\n                                 source_Plot_Scatter.data['y'] = [0, 0, z1, z2, h1, h2];\n                                 source_Plot_Scatter.change.emit();\n                                 \n                                 // update line labels\n                                 const fac = 10\n                                 source_Labels.data['x'] = [L/2,0,L,0,L,0,L,0,L];\n                                 source_Labels.data['y'] = [0,0,0,z1,z2,z1+ph1/2,z2+ph2/2,h1,h2];\n                                 source_Labels.data['x_offset'] = [0, 0, 0, fac, -fac, fac, -fac, -fac, fac];\n                                 source_Labels.data['y_offset'] = [fac, -fac, -fac, 0, 0, 0, 0, 0, 0];\n                                 source_Labels.change.emit();\n                                 \n                                 // update wells\n                                 const width_well = 0.03*L;\n                                 \n                                 source_Well1.data['x'] = [-width_well/2, width_well/2, width_well/2, -width_well/2, -width_well/2]\n                                 source_Well1.data['y'] = [z1, z1, 1.5*Math.max(h1,h2), 1.5*Math.max(h1,h2), z1];\n                                 source_Well1.change.emit();\n                                 \n                                 source_Well1_Water.data['x'] = [-width_well/2, width_well/2]\n                                 source_Well1_Water.data['y1'] = [z1, z1];\n                                 source_Well1_Water.data['y2'] = [h1, h1];\n                                 source_Well1_Water.change.emit();\n                                 \n                                 source_Well2.data['x'] = [L-width_well/2, L+width_well/2, L+width_well/2, L-width_well/2, L-width_well/2];\n                                 source_Well2.data['y'] = [z2, z2, 1.5*Math.max(h1,h2), 1.5*Math.max(h1,h2), z2];\n                                 source_Well2.change.emit();\n                                 \n                                 source_Well2_Water.data['x'] = [L-width_well/2, L+width_well/2]\n                                 source_Well2_Water.data['y1'] = [z2, z2];\n                                 source_Well2_Water.data['y2'] = [h2, h2];\n                                 source_Well2_Water.change.emit();\n                                 \n                                 source_Well1_Air.data['x'] = [-width_well/2, width_well/2];\n                                 source_Well1_Air.data['y1'] = [h1, h1];\n                                 source_Well1_Air.data['y2'] = [1.5*Math.max(h1,h2), 1.5*Math.max(h1,h2)];\n                                 source_Well1_Air.change.emit();\n                                 \n                                 source_Well2_Air.data['x'] = [L-width_well/2, L+width_well/2];\n                                 source_Well2_Air.data['y1'] = [h2, h2];\n                                 source_Well2_Air.data['y2'] = [1.5*Math.max(h1,h2), 1.5*Math.max(h1,h2)];\n                                 source_Well2_Air.change.emit()\n                                 \n                                 // update fill\n                                 source_Fill.data['x'] = [-0.1*L, 1.1*L];\n                                 source_Fill.data['y2'] = [1.3*Math.max(h1,h2), 1.3*Math.max(h1,h2)];\n                                 source_Fill.change.emit();\n                                 \n                                 "},"id":"64323","type":"CustomJS"},{"attributes":{"editor":{"id":"65621"},"field":"ParameterValue","formatter":{"id":"65620"},"title":"ParameterValue"},"id":"64145","type":"TableColumn"},{"attributes":{"children":[{"id":"64328"}],"sizing_mode":"stretch_width"},"id":"64340","type":"Column"},{"attributes":{"line_alpha":0.1,"line_color":"blue","line_width":2,"x":{"field":"theta"},"y":{"field":"psi"}},"id":"64452","type":"Line"},{"attributes":{"end":3,"js_property_callbacks":{"change:value":[{"id":"64323"}]},"start":1,"step":0.1,"title":"Elevation head at (1), z1 (m)","value":1.2},"id":"64149","type":"Slider"},{"attributes":{},"id":"64167","type":"LinearScale"},{"attributes":{"js_property_ca                             return [es,e,lv,Er,rho_vs,u_star,Ea,delta,gamma,ddg,gdg,Ec,rho_v];\n                                    }                                    \n                                    \n                                // update table source data ///////////////////\n                                let EvaporationParameters = getEvaporationParameters(Ta,Rh,Rn,rhow,u,z,z0,Cp,Patm)\n                                \n                                lv = lv/1000 // convert J/kg to kJ/kg\n                                sourceEvaporationParameterTable.data['Value'][0] = lv.toFixed(3);\n                                Er = Er*1000*86400 // convert m/s to mm/d\n                                sourceEvaporationParameterTable.data['Value'][1] = Er.toFixed(2);\n                                sourceEvaporationParameterTable.data['Value'][2] = es.toFixed(2);\n                                sourceEvaporationParameterTable.data['Value'][3] = rho_vs.toFixed(4);\n                                sourceEvaporationParameterTable.data['Value'][4] = u_star.toFixed(4);\n                                Ea = Ea*1000*86400 // convert m/s to mm/d\n                                sourceEvaporationParameterTable.data['Value'][5] = Ea.toFixed(2);\n                                sourceEvaporationParameterTable.data['Value'][6] = delta.toFixed(4);\n                                sourceEvaporationParameterTable.data['Value'][7] = gamma.toFixed(4);\n                                sourceEvaporationParameterTable.data['Value'][8] = ddg.toFixed(4);\n                                sourceEvaporationParameterTable.data['Value'][9] = gdg.toFixed(4);\n                                Ec = Ec*1000*86400 // convert m/s to mm/d\n                                sourceEvaporationParameterTable.data['Value'][10] = Ec.toFixed(2);\n                                \n                                sourceEvaporationParameterTable.change.emit();\n\n                                // upodate xis":{"id":"65289"},"coordinates":null,"dimension":1,"group":null,"ticker":null},"id":"65292","type":"Grid"},{"attributes":{},"id":"64604","type":"LinearScale"},{"attributes":{"args":{"slider_psi1":{"id":"64354"},"slider_psi2":{"id":"64355"},"slider_z1":{"id":"64352"},"slider_z2":{"id":"64353"},"sourceSoilProperties_ALL":{"id":"64344"},"sourceSoilProperties_SELECTED":{"id":"64345"},"source_Labels":{"id":"64411"},"source_OutputTable":{"id":"64356"},"source_ScatterPoints":{"id":"64365"},"source_VG_Curves":{"id":"64415"},"source_WT":{"id":"64416"}},"code":"\n                             \n                        // get slider values /////////////////////////////\n                        const z1 = slider_z1.value;\n                        const z2 = slider_z2.value;\n                        const psi1 = slider_psi1.value;\n                        const psi2 = slider_psi2.value;\n                        \n                        // get soil properties ///////////////////////////\n                        var theta_r = sourceSoilProperties_SELECTED.data['ParameterValue'][0];\n                        var theta_s = sourceSoilProperties_SELECTED.data['ParameterValue'][1];\n                        var alpha = sourceSoilProperties_SELECTED.data['ParameterValue'][2];\n                        var beta = sourceSoilProperties_SELECTED.data['ParameterValue'][3];\n                        var Ks = sourceSoilProperties_SELECTED.data['ParameterValue'][4];\n\n                        // van Genuchten function /////////////////////////////\n                        var theta, K, Se\n                        const m = 1 - 1/beta\n                        function getVanGenuchten(psi) {\n                            if (psi &lt; 0) {\n                                theta = theta_r + (theta_s - theta_r)/((1+Math.abs(alpha*psi)**beta)**m);\n                                Se = (theta - theta_r)/(theta_s - theta_r);\n                                K = Ks*Se*(1 - (1 - Se**(1/m))**m)**2;\n                                     }\n                            else {\n                                theta = theta_s;\n                                K = Ks;\n                                Se = 1;\n                                }\n                            return [theta, Se, K]\n                            }\n\n                        // calcs for points 1 and 2 ///////////////////////////\n                        const h1 = z1 + psi1;\n                        const h2 = z2 + psi2;\n                        const dh = h2-h1;\n                        const dhdz = (h2-h1)/(z2-z1);\n                        let VG1 = getVanGenuchten(psi1);\n                        const theta1 = VG1[0];\n                        const Se1 = VG1[1];\n                        const K1 = VG1[2];\n                        let VG2 = getVanGenuchten(psi2);\n                        const theta2 = VG2[0];\n                        const Se2 = VG2[1];\n                        const K2 = VG2[2];\n                        const Kavg = (K1+K2)/2;\n                        const q1 = -K1*dhdz;\n                        const q2 = -K2*dhdz;\n                        const qavg = -Kavg*dhdz;\n\n                        // update output data /////////////////////////////////\n                        source_OutputTable.data['Value'][0] = theta1.toFixed(4);\n                        source_OutputTable.data['Value'][1] = theta2.toFixed(4);\n                        source_OutputTable.data['Value'][2] = Se1.toFixed(4);\n                        source_OutputTable.data['Value'][3] = Se2.toFixed(4);\n                        source_OutputTable.data['Value'][4] = K1.toExponential(3);\n                        source_OutputTable.data['Value'][5] = K2.toExponential(3);\n                        source_OutputTable.data['Value'][6] = Kavg.toExponential(3);\n                        source_OutputTable.data['Value'][7] = h1.toFixed(2);\n                        source_OutputTable.data['Value'][8] = h2.toFixed(2);\n                        source_OutputTable.data['Value'][9] = dh.toFixed(2);\n                        source_OutputTable.data['Value'][10] = dhdz.toFixed(4);\n                        source_OutputTable.data['Value'][11] = q1.toExponential(3);\n                        source_OutputTable.data['Value'][12] = q2.toExponential(3);\n                        source_OutputTable.data['Value'][13] = qavg.toExponential(3);\n                        source_OutputTable.change.emit();\n                               \n                        // update scatter points\n                        source_ScatterPoints.data['psi'] = [psi1,psi2];\n                        source_ScatterPoints.data['theta'] = [theta1,theta2];\n                        source_ScatterPoints.data['K'] = [K1,K2];\n                        source_ScatterPoints.data['z'] = [z1,z2];\n                        source_ScatterPoints.data['h'] = [h1,h2];\n                        var string1 = '(' + theta1.toFixed(3).toString() + ', ' + psi1.toFixed(2).toString() + ')';\n                        var string2 = '(' + theta2.toFixed(3).toString() + ', ' + psi2.toFixed(2).toString() + ')';\n                        source_ScatterPoints.data['label_theta'] = [string1, string2]\n                        var string1 = '(' + K1.toExponential(3).toString() + ', ' + psi1.toFixed(2).toString() + ')';\n                        var string2 = '(' + K2.toExponential(3).toString() + ', ' + psi2.toFixed(2).toString() + ')';\n                        source_ScatterPoints.data['label_K'] = [string1, string2]\n                        \n                        source_ScatterPoints.change.emit();\n                        \n                        // update scatter point labels\n                        //source_Labels.data['label'] = ['Datum, z=0','z1 = '+z1.toFixed(1).toString()+'cm, psi1 = '+psi1.toFixed(1).toString()+'cm','z2 = '+z2.toFixed(1).toString()+'cm, psi2 = '+psi2.toFixed(1).toString()+'cm','h1 = '+h1.toFixed(1).toString()+'cm','h2 = '+h2.toFixed(1).toString()+'cm']\n                        source_Labels.data['y'] = [0,z1,z2,h1,h2]\n                        source_Labels.change.emit();\n\n                        // compute vg curves //////////////////////////////////\n                        const psi = source_VG_Curves.data['psi'];\n                        for (var ii = 0; ii &lt; psi.length; ii++) {\n                            let VG = getVanGenuchten(psi[ii])\n                            source_VG_Curves.data['theta'][ii] = VG[0];\n                            source_VG_Curves.data['Se'][ii] = VG[1];\n                            source_VG_Curves.data['K'][ii] = VG[2];\n                            source_VG_Curves.data['theta_r'][ii] = theta_r;\n                            source_VG_Curves.data['theta_s'][ii] = theta_s;\n                            source_VG_Curves.data['Ks'][ii] = Ks;\n                                }\n                        source_VG_Curves.change.emit();\n                        \n                        // update WT data /////////////////////////////////////\n                        source_WT.data['theta'] = [source_VG_Curves.data['theta'][0], source_VG_Curves.data['theta'][psi.length-1]];\n                        source_WT.data['K'] = [source_VG_Curves.data['K'][0], source_VG_Curves.data['K'][psi.length-1]];\n                        source_WT.change.emit();\n\n                             "},"id":"64558","type":"CustomJS"},{"attributes":{"editor":{"id":"65649"},"field":"Value","formatter":{"id":"65648"},"title":"Value","width":80},"id":"64726","type":"TableColumn"},{"attributes":{"children":[{"id":"65374"}]},"id":"65397","type":"Column"},{"attributes":{"coordinates":null,"data_source":{"id":"64730"},"glyph":{"id":"64771"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"64773"},"name":"hover","nonselection_glyph":{"id":"64772"},"view":{"id":"64775"}},"id":"64774","type":"GlyphRenderer"},{"attributes":{},"id":"65290","type":"BasicTicker"},{"attributes":{"children":[{"id":"64366"},{"id":"64417"},{"id":"64488"}],"sizing_mode":"scale_height"},"id":"64567","type":"Row"},{"attributes":{},"id":"65294","type":"PanTool"},{"attributes":{"children":[{"id":"65396"},{"id":"65397"}]},"id":"65398","type":"Row"},{"attributes":{"button_type":"success","icon":null,"js_event_callbacks":{"button_click":[{"id":"64560"}]},"label":"Click to Restore Defaults","width":100},"id":"64559","type":"Button"},{"attributes":{"overlay":{"id":"65297"}},"id":"65293","type":"BoxSelectTool"},{"attributes":{"children":[{"id":"65386"}],"sizing_mode":"stretch_width"},"id":"65399","type":"Column"},{"attributes":{},"id":"65296","type":"ResetTool"},{"attributes":{"sizing_mode":"stretch_width","text":"&lt;h2&gt;Background&lt;/h2&gt;\n        \n        &lt;h3&gt;The unsaturated zone&lt;/h3&gt;\n        &lt;p&gt;The unsaturated zone existis above the watertable in an unconfined aquifer. In this zone, the pore spaces contain a mix of air and water, as opposed to the saturated zone where pores are filled with water only. \n        The water (or moisture) in this zone exists due to capillary suction forces \"sucking\" water up from the saturated zone. Hence, the pore water pressure here is negative. \n        In addition, the hydraulic conductivity (the measure of how easily water flows through the soil) is a strongly decreasing function of moisture content due to the additional work required by the water to displace the air.\n        &lt;/p&gt;\n        \n        &lt;h3&gt;Darcy's law&lt;/h3&gt;\n        &lt;p&gt;Darcy's law also applies in the unsatuarted zone with the following two special considerations &lt;br&gt;\n            &lt;ol&gt;\n                &lt;li&gt;the pore water pressure $$p$$ (and hence pressure head $$\\psi = p/\\rho g$$) is negative and &lt;/li&gt;\n                &lt;li&gt;the hydraulic conductivity is non-linearly dependent on the moisture content $$K=K\\left(\\theta\\right)$$&lt;/li&gt;\n            &lt;/ol&gt;\n        &lt;p&gt;\n        &lt;p&gt;Darcy's law is therefore written as, &lt;br&gt;\n            $$\\quad q = -K\\left(\\theta\\right)\\nabla h \\quad [L/T]$$ &lt;br&gt;\n            where \n            $$q$$ is known as Darcy's flux which represents the flow per unit area $$\\left(Q/A\\right)$$, \n            $$K\\left(\\theta\\right)$$ is the hydraulic conductivity $$[L/T]$$ and &lt;br&gt;\n            $$\\quad \\nabla h = \\left( \\frac{\\partial h}{\\partial x} + \\frac{\\partial h}{\\partial y} + \\frac{\\partial h}{\\partial z} \\right) $$ is the pizometric head gradient &lt;br&gt;\n            with the piezometric head, &lt;br&gt;\n            $$\\quad h = z + \\psi$$\n        &lt;/p&gt;\n\n        &lt;h3&gt;Moisture retention curves&lt;/h3&gt;\n        &lt;p&gt;There are many different functions to describe the soil mositure characteristics of various soil types. \n           One of the more widely used (and the one used here) are the following &lt;b&gt;van Genuchten (1980)&lt;/b&gt; formulae.\n        &lt;/p&gt;\n        &lt;p&gt;The moisture content is given by, &lt;br&gt;\n            $$\\quad \\theta \\left(\\psi\\right) = \\theta_r + \\frac{ \\theta_s - \\theta_r }{(1+|\\alpha \\psi|^\\beta)^m}$$ for $$\\psi &lt; 0$$ &lt;br&gt;\n            $$\\quad \\theta \\left(\\psi\\right) = \\theta_s$$ for $$\\psi \\geq 0$$ &lt;br&gt;\n            where &lt;br&gt;\n            $$\\qquad \\psi$$ is the pore water pressure ($$\\psi&lt;0$$ in the unsaturated zone) &lt;br&gt;\n            $$\\qquad \\theta_r $$ is the residual mositure content &lt;br&gt;\n            $$\\qquad \\theta_s $$ is the saturated mositure content &lt;br&gt;\n            $$\\qquad m = 1 - 1/\\beta$$ &lt;br&gt;\n            and $$\\alpha$$ and $$\\beta$$ are empirical fitting parameters unique to the soil type.\n        &lt;/p&gt;\n        &lt;p&gt;The hydraulic conductivity is given by, &lt;br&gt;\n            $$\\quad K\\left(\\theta\\right) = K_s S_e \\left[1 - \\left(1 - S_e^{1/m}\\right)^m\\right]^2 $$ &lt;br&gt;\n            were $$K_s$$ is the saturated hydraulic conductivity and $$S_e$$ is the effective saturation, &lt;br&gt; \n            $$\\quad S_e = \\frac{ \\theta - \\theta_r}{ \\theta_s - \\theta_r}$$\n        &lt;/p&gt;\n\n                    ","width":400},"id":"64562","type":"Div"},{"attributes":{"children":[{"id":"65384"},{"id":"65398"},{"id":"65399"},{"id":"65390"}]},"id":"65400","type":"Column"},{"attributes":{"bottom_units":"screen","coordinates":null,"fill_alpha":0.5,"fill_color":"lightgrey","group":null,"left_units":"screen","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"right_units":"screen","syncable":false,"top_units":"screen"},"id":"65297","type":"BoxAnnotation"},{"attributes":{"coordinates":null,"data_source":{"id":"64365"},"glyph":{"id":"64549"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"64551"},"nonselection_glyph":{"id":"64550"},"view":{"id":"64553"}},"id":"64552","type":"GlyphRenderer"},{"attributes":{"child":{"id":"64572"},"title":"Groundwater (UZ)"},"id":"64573","type":"Panel"},{"attributes":{"child":{"id":"65400"},"title":"Flood Routing (Res.)"},"id":"65401","type":"Panel"},{"attributes":{"args":{"SoilTypeSelection":{"id":"64346"},"slider_psi1":{"id":"64354"},"slider_psi2":{"id":"64355"},"slider_z1":{"id":"64352"},"slider_z2":{"id":"64353"},"sourceSoilProperties_ALL":{"id":"64344"},"sourceSoilProperties_SELECTED":{"id":"64345"},"source_InputParameters":{"id":"64343"}},"code":"\n                                     \n                                         // sliders ///////////////////////////\n                                         slider_z1.value = source_InputParameters.data['Value'][0];\n                                         slider_z2.value = source_InputParameters.data['Value'][1];\n                                         slider_psi1.value = source_InputParameters.data['Value'][2];\n                                         slider_psi2.value = source_InputParameters.data['Value'][3];\n\n                                         // soil type selection ///////////////\n                                         const Parameter = ['theta_r', 'theta_s', 'alpha (1/cm)', 'beta', 'Ks (cm/d)'];\n                                         var SoilType = sourceSoilProperties_ALL.data['Soil Type'];\n                                         var ind = SoilType.indexOf('Sand');\n                                         for (var i = 0; i &lt; Parameter.length; i++) {\n                                             sourceSoilProperties_SELECTED.data['ParameterValue'][i] = sourceSoilProperties_ALL.data[Parameter[i]][ind];\n                                         }\n                                         sourceSoilProperties_SELECTED.change.emit();\n                                         SoilTypeSelection.value = 'Sand'\n                                         \n                                         "},"id":"64560","type":"CustomJS"},{"attributes":{"fill_color":{"field":"color"},"marker":{"value":"circle_dot"},"size":{"value":12},"x":{"field":"K"},"y":{"field":"psi"}},"id":"64549","type":"Scatter"},{"attributes":{"toolbar":{"id":"65372"},"toolbar_location":"above"},"id":"65373","type":"ToolbarBox"},{"attributes":{"source":{"id":"64416"}},"id":"64546","type":"CDSView"},{"attributes":{"callback":null,"names":["hover"],"tooltips":[["G (m^3/s)","@G{0.2f}"],["O (m^3/s)","@O{0.2f}"]]},"id":"65321","type":"HoverTool"},{"attributes":{"source":{"id":"64365"}},"id":"64553","type":"CDSView"},{"attributes":{"coordinates":null,"data_source":{"id":"64416"},"glyph":{"id":"64542"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"64544"},"nonselection_glyph":{"id":"64543"},"view":{"id":"64546"}},"id":"64545","type":"GlyphRenderer"},{"attributes":{"line_alpha":0.2,"line_color":"#1f77b4","x":{"field":"G"},"y":{"field":"O"}},"id":"65306","type":"Line"},{"attributes":{"fill_alpha":{"value":0.1},"fill_color":{"field":"color"},"hatch_alpha":{"value":0.1},"line_alpha":{"value":0.1},"marker":{"value":"circl d":"64967","type":"HoverTool"},{"attributes":{},"id":"65172","type":"DataRange1d"},{"attributes":{"coordinates":null,"data_source":{"id":"64916"},"glyph":{"id":"64962"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"64964"},"nonselection_glyph":{"id":"64963"},"view":{"id":"64966"}},"id":"64965","type":"GlyphRenderer"},{"attributes":{"axis_label":"$$O \\quad (m^3/s)$$","coordinates":null,"formatter":{"id":"65217"},"group":null,"major_label_policy":{"id":"65218"},"ticker":{"id":"65183"}},"id":"65182","type":"LinearAxis"},{"attributes":{"logo":null,"tools":[{"id":"63932"},{"id":"63933"},{"id":"63934"},{"id":"63935"},{"id":"63962"}]},"id":"63937","type":"Toolbar"},{"attributes":{"args":{"slider_Q":{"id":"64837"},"slider_S":{"id":"64840"},"slider_Sside":{"id":"64841"},"slider_W":{"id":"64838"},"slider_n":{"id":"64839"},"source_OutputTable":{"id":"64842"},"source_PlotData":{"id":"64849"},"source_PlotData_Trapz":{"id":"64916"}},"code":"\n                            // get slider values //////////////////////////////\n                            const Q = slider_Q.value;\n                            const W = slider_W.value;\n                            const n = slider_n.value;\n                            const S = slider_S.value;\n                            const Sside = slider_Sside.value;\n                            \n                            // Mannings function (rectangular Area) ///////////\n                            var y, y_approx, tol, dy, count, A, P, R, y_new, y_old, Wy, err, V\n                            function Mannings(Q,W,n,S){\n                                y_approx = (n*Q/W/Math.sqrt(S))**(3/5);\n                                y_old = y_approx;\n                                tol = 10**-10;\n                                dy = tol + 1;\n                                count = 0;\n                                while (dy &gt;= tol) {\n                                    A = y_old*W;\n                                    P = 2*y_old + W;\n                                    R = A/P;\n                                    y_new = n*Q/W/R**(2/3)/Math.sqrt(S);\n                                    dy = Math.abs(y_new-y_old);\n                                    y_old = y_new;\n                                    count += 1;\n                                    }\n                                y = y_new;\n                                Wy = W/y;\n                                V = Q/A\n                                err = 100 - 100*y_approx/y;\n                                return [A, P, R, y, count, y_approx, Wy, err, V] \n                                }\n\n                            // Mannings function (trapezoidal Area) ///////////\n                            var y, y_approx, tol, dy, count, A, P, R, y_new, y_old, Wy, err, V, x, Wbase\n                            function ManningsTrapezoid(Q,W,n,S,Sside){\n                                y_approx = (n*Q/W/Math.sqrt(S))**(3/5)\n                                y_old = y_approx\n                                tol = 10**-10\n                                dy = tol + 1\n                                count = 0\n                                while (dy &gt;= tol) {\n                                    x = y_old/Sside\n                                    Wbase = W-2*x\n                                    A = y_old*W + x*y_old\n                                    P = Wbase + 2*Math.sqrt(x**2 + y_old**2)\n                                    R = A/P\n                                    y_new = n*Q/(Wbase+y_old/Sside)/R**(2/3)/Math.sqrt(S)\n                                    if (y_new &lt; 0){\n                                        y_new=0\n                                        }\n                                    dy = Math.abs(y_new-y_old)\n                                    y_old = y_new\n                                    count += 1\n                                    }\n                                y = y_new\n                                Wy = NaN\n                                V = Q/A\n                                err = NaN\n                                return [A, P, R, y, count, y_approx, Wy, err, V, x, Wbase]\n                                }\n\n                                // output table calcs ///////////////////////////////////\n                                let data = Mannings(Q,W,n,S)\n                                source_OutputTable.data['Rectangular'][0] = A.toFixed(3);\n                                source_OutputTable.data['Rectangular'][1] = P.toFixed(3);\n                                source_OutputTable.data['Rectangular'][2] = R.toFixed(3);\n                                source_OutputTable.data['Rectangular'][3] = y.toFixed(3);\n                                source_OutputTable.data['Rectangular'][4] = count.toFixed(0);\n                                source_OutputTable.data['Rectangular'][5] = y_approx.toFixed(3);\n                                source_OutputTable.data['Rectangular'][6] = Wy.toFixed(3);\n                                source_OutputTable.data['Rectangular'][7] = err.toFixed(2);\n                                source_OutputTable.data['Rectangular'][8] = V.toFixed(2);\n\n                                // update plot data ////////////////////////////\n                                source_PlotData.data['x'] = [0,0,W,W];\n                                source_PlotData.data['wall'] = [1.1*y,0,0,1.1*y];\n                                source_PlotData.data['y'] = [y,y,y,y];\n                                source_PlotData.data['y_approx'] = [y_approx,y_approx,y_approx,y_approx];\n                                source_PlotData.data['V'] = [V,V,V,V];\n                                source_PlotData.data['A'] = [A,A,A,A];\n                                source_PlotData.data['P'] = [P,P,P,P];\n                                source_PlotData.data['R'] = [R,R,R,R];\n                                \n                                source_PlotData.change.emit();\n                                \n                                let dataTrapz = ManningsTrapezoid(Q,W,n,S,Sside)\n                                if (Wbase &lt; 0.5){ // trapezoid at this surface width is not practical\n                                    source_OutputTable.data['Trapezoid'][0] = 'Width of base &lt; 0.5m';\n                                    source_OutputTable.data['Trapezoid'][1] = 'which is impractical';\n                                    source_OutputTable.data['Trapezoid'][2] = 'Increase surface width';\n                                    source_OutputTable.data['Trapezoid'][3] = 'or increase the side slope';\n                                    source_OutputTable.data['Trapezoid'][4] = ' ';\n                                    source_OutputTable.data['Trapezoid'][8] = ' ';\n                                    source_PlotData_Trapz.data['x'] = [NaN, NaN, NaN, NaN, NaN, NaN]\n                                    source_PlotData_Trapz.data['wall'] = [NaN, NaN, NaN, NaN, NaN, NaN]\n                                    source_PlotData_Trapz.data['y'] = [NaN, NaN, NaN, NaN, NaN, NaN]\n                                        }\n                                else {\n                                    source_OutputTable.data['Trapezoid'][0] = A.toFixed(3);\n                                    source_OutputTable.data['Trapezoid'][1] = P.toFixed(3);\n                                    source_OutputTable.data['Trapezoid'][2] = R.toFixed(3);\n                                    source_OutputTable.data['Trapezoid'][3] = y.toFixed(3);\n                                    source_OutputTable.data['Trapezoid'][4] = count.toFixed(0);\n                                    source_OutputTable.data['Trapezoid'][8] = V.toFixed(2);\n                                    const x0 = -0.1*y/Sside\n                                    source_PlotData_Trapz.data['x'] = [x0, 0, y/Sside, y/Sside + Wbase, W, W-x0]\n                                    source_PlotData_Trapz.data['wall'] = [1.1*y, y, 0, 0, y, 1.1*y]\n                                    source_PlotData_Trapz.data['y'] = [NaN, y, y, y, y, NaN]\n                                    source_PlotData.data['V'] = [V,V,V,V];\n                                    source_PlotData.data['A'] = [A,A,A,A];\n                                    source_PlotData.data['P'] = [P,P,P,P];\n                                    source_PlotData.data['R'] = [R,R,R,R];\n\n                                    }\n                                source_OutputTable.data['Trapezoid'][5] = NaN;\n                                source_OutputTable.data['Trapezoid'][6] = NaN;\n                                source_OutputTable.data['Trapezoid'][7] = NaN;\n                                \n                                source_OutputTable.change.emit();                               \n                                source_PlotData_Trapz.change.emit();\n\n                            "},"id":"64970","type":"CustomJS"},{"attributes":{},"id":"65176","type":"LinearScale"},{"attributes":{},"id":"65015","type":"LinearScale"},{"attributes":{},"id":"65179","type":"BasicTicker"},{"attributes":{"source":{"id":"64916"}},"id":"64966","type":"CDSView"},{"attributes":{"label":{"value":"500*D (m)"},"renderers":[{"id":"64780"}]},"id":"64794","type":"LegendItem"},{"attributes":{"axis":{"id":"65178"},"coordinates":null,"group":null,"ticker":null},"id":"65181","type":"Grid"},{"attributes":{"bottom_units":"screen","coordinates":null,"fill_alpha":0.5,"fill_color":"lightgrey","group":null,"left_units":"screen","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"right_units":"screen","syncable":false,"top_units":"screen"},"id":"63936","type":"BoxAnnotation"},{"attributes":{"source":{"id":"64730"}},"id":"64769","type":"CDSView"},{"attributes":{"fill_alpha":{"value":0.1},"fill_color":{"field":"color"},"hatch_alpha":{"value":0.1},"line_alpha":{"value":0.1},"marker":{"value":"circle_dot"},"size":{"value":10},"x":{"field":"xPoint"},"y":{"field":"yPoint"}},"id":"63953","type":"Scatter"},{"attributes":{},"id":"65358","type":"AllLabels"},{"attributes":{"args":{"slider_Q":{"id":"64837"},"slider_S":{"id":"64840"},"slider_Sside":{"id":"64841"},"slider_W":{"id":"64838"},"slider_n":{"id":"64839"},"source_InputParameters":{"id":"64836"}},"code":"\n                                     \n                                         // sliders ///////////////////////////\n                                         slider_Q.value = source_InputParameters.data['Value'][0];\n                                         slider_W.value = source_InputParameters.data['Value'][1];\n                                         slider_n.value = source_InputParameters.data['Value'][2];\n                                         slider_S.value = source_InputParameters.data['Value'][3];\n                                         slider_Sside.value = source_InputParameters.data['Value'][4];\n                                         \n                                         "},"id":"64972","type":"CustomJS"},{"attributes":{"coordinates":null,"data_source":{"id":"63914"},"glyph":{"id":"63948"},"group":null,"hover_glyph":null,"name":"profile","view":{"id":"63950"}},"id":"63949","type":"GlyphRenderer"},{"attributes":{"axis":{"id":"65182"},"coordinates":null,"dimension":1,"group":null,"ticker":null},"id":"65185","type":"Grid"},{"attributes":{"data":{"color":["blue","green","red"],"index":[0,1,2],"xPoint":[55,55,55],"yPoint":{"__ndarray__":"T1yAyxRGGkA+aG38CXk2QPBR1m9ecCRA","dtype":"float64","order":"little","shape":[3]}},"selected":{"id":"65577"},"selection_policy":{"id":"65576"}},"id":"63966","type":"ColumnDataSource"},{"attributes":{"bottom_units":"screen","coordinates":null,"fill_alpha":0.5,"fill_color":"lightgrey","group":null,"left_units":"screen","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"right_units":"screen","syncable":false,"top_units":"screen"},"id":"64752","type":"BoxAnnotation"},{"attributes":{},"id":"65183","type":"BasicTicker"},{"attributes":{},"id":"65357","type":"BasicTickFormatter"},{"attributes":{"line_color":"blue","line_width":2,"x":{"field":"x"},"y":{"field":"zD"}},"id":"64771","type":"Line"},{"attributes":{"text":"&lt;h2&gt;Computed Parameters&lt;/h2&gt;"},"id":"64130","type":"Div"},{"attributes":{},"id":"65188","type":"WheelZoomTool"},{"attributes":{},"id":"65187","type":"PanTool"},{"attributes":{},"id":"65355","type":"AllLabels"},{"attributes":{"text":"&lt;h2&gt;Computed Parameters&lt;/h2&gt;\n                                   &lt;meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\"&gt;"},"id":"64975","type":"Div"},{"attributes":{"overlay":{"id":"65190"}},"id":"65186","type":"BoxSelectTool"},{"attributes":{},"id":"63934","type":"WheelZoomTool"},{"attributes":{"fill_alpha":0.2,"fill_color":"saddlebrown","hatch_alpha":{"value":0.2},"x":{"field":"x"},"y1":{"value":0},"y2":{"field":"z"}},"id":"64767","type":"VArea"},{"attributes":{"data":{"color":["blue","green","red"],"index":[0,1,2],"xPoint":{"__ndarray__":"AAAAAACAPEAAAAAAAIA8QAAAAAAAgDxA","dtype":"float64","order":"little","shape":[3]},"yPoint":{"__ndarray__":"T1yAyxRGGkA+aG38CXk2QPBR1m9ecCRA","dtype":"float64","order":"little","shape":[3]}},"selected":{"id":"65575"},"selection_policy":{"id":"65574"}},"id":"64019","type":"ColumnDataSource"},{"attributes":{},"id":"65189","type":"ResetTool"},{"attributes":{},"id":"65354","type":"BasicTickFormatter"},{"attributes":{"fill_alpha":{"value":0.5},"fill_color":{"field":"color"},"hatch_alpha":{"value":0.5},"line_alpha":{"value":0.5},"marker":{"value":"circle_dot"},"size":{"value":10},"x":{"field":"xPoint"},"y":{"field":"yPoint"}},"id":"63952","type":"Scatter"},{"attributes":{"child":{"id":"64982"},"title":"Channel Flow"},"id":"64983","type":"Panel"},{"attributes":{"line_alpha":0.1,"line_color":"blue","line_width":2,"x":{"field":"x"},"y":{"field":"zD"}},"id":"64772","type":"Line"},{"attributes":{"bottom_units":"screen","coordinates":null,"fill_alpha":0.5,"fill_color":"lightgrey","group":null,"left_units":"screen","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"right_units":"screen","syncable":false,"top_units":"screen"},"id":"65190","type":"BoxAnnotation"},{"attributes":{"button_type":"success","icon":null,"js_event_callbacks":{"button_click":[{"id":"64972"}]},"label":"Click to Restore Defaults","width":100},"id":"64971","type":"Button"},{"attributes":{"text":"\n        &lt;meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\"&gt;\n        &lt;h2&gt;Background&lt;/h2&gt;\n        &lt;meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\"&gt;\n        &lt;img src=\"images/channel schematic.png\" alt=\"Channel Flow Schematic\" width=500&gt;\n        &lt;p style=\"color:red; font-size: 150%\"&gt;Under construction&lt;/p&gt;\n        \n        &lt;h3&gt;Steady, uniform flow equation&lt;/h3&gt;\n        &lt;p&gt;Under the assumptions of &lt;u&gt;&lt;b&gt;steady, uniform&lt;/b&gt;&lt;/u&gt; flow, application of Newton's 2nd law $$\\left(\\sum F = 0 \\right)$$ to a surface flow system leads to the following equation for the mean flow velocity, &lt;br&gt;\n            $$\\quad V = \\sqrt{\\frac{2g}{C_D}R\\sin{\\theta}} $$ &lt;br&gt;\n            where &lt;br&gt;\n            $$\\qquad R = \\frac{A}{P} $$ is the hydraulic radius $$[L]$$ with $$A$$ the flow cross-sectional area $$[L^2]$$ and $$P$$ the wetted perimeter $$[L]$$. &lt;br&gt;\n            $$\\qquad \\theta$$ is the angle of the overland slope &lt;br&gt;\n            $$\\qquad g = 9.81 m/s^2$$ is the acceleration due to gravity &lt;br&gt;\n            $$\\qquad C_D$$ is the drag coeficient.\n        &lt;/p&gt;\n        \n        &lt;h3&gt;Application to (turbulent) channel flow&lt;/h3&gt;\n        &lt;p&gt;Typically, the longitudinal slope of open channels is usually very small (small $$\\theta$$) and therefore,&lt;br&gt;\n            $$\\quad \\sin \\theta \\approx \\tan \\theta = S$$ &lt;br&gt;\n            where $$S$$ is the channel slope or longitudinal gradient. Therfore the velocity equation becomes, &lt;br&gt;\n            $$\\quad V = \\sqrt{\\frac{2g}{C_D}RS} = C \\sqrt{RS}$$ &lt;br&gt;\n            where &lt;br&gt;\n            $$\\qquad C = \\sqrt{\\frac{2g}{C_D}} $$&lt;br&gt;\n            is known as Chezy's coefficient.\n        &lt;/p&gt;\n        &lt;p&gt;In 1889, Manning found that Chezy's coefficient is dependent on the flow geometry,&lt;br&gt;\n            $$\\quad C = \\frac{1}{n}R^{1/6}$$ &lt;br&gt;\n            where $$n$$ is Manning's roughness coefficient and $$R=A/P$$ is the hydraulic radius with $$A$$ the cross-sectional area and $$P$$ the wetted perimeter.\n        &lt;/p&gt;\n        &lt;p&gt;Substitution into the velocity equation yields Manning's equation,&lt;br&gt;\n            $$\\quad V = \\frac{1}{n}R^{2/3}S^{1/2}$$ &lt;br&gt;\n            or, in terms of the discharge $$Q = VA$$, &lt;br&gt;\n            $$\\quad Q = \\frac{A}{n}R^{2/3}S^{1/2}$$\n        &lt;/p&gt;\n        \n        &lt;h3&gt;Wide, shallow channel approximation&lt;/h3&gt;\n        &lt;p&gt;Under the wide, shallow channel approximation $$W &gt;&gt; D$$, the hydraulic radius becomes, &lt;br&gt;\n            $$\\quad R = \\frac{A}{P} = \\frac{WD}{2D+W} \\approx \\frac{WD}{W} = D $$ &lt;br&gt;\n            therefore Manning's equation becomes, &lt;br&gt;\n            $$\\quad V \\approx \\frac{1}{n}D^{2/3}S^{1/2}$$\n        &lt;/p&gt;\n                    "},"id":"64974","type":"Div"},{"attributes":{"text":"&lt;h2&gt;User Input Controls&lt;/h2&gt;"},"id":"64978","type":"Div"},{"attributes":{"axis_label":"Rn (W/m^2)","coordinates":null,"formatter":{"id":"65493"},"group":null,"major_label_policy":{"id":"65494"},"ticker":{"id":"63925"}},"id":"63924","type":"LinearAxis"},{"attributes":{"coordinates":null,"data_source":{"id":"63914"},"glyph":{"id":"63945"},"group":null,"hover_glyph":null,"name":"profile","view":{"id":"63947"}},"id":"63946","type":"GlyphRenderer"},{"attributes":{"source":{"id":"63914"}},"id":"63947","type":"CDSView"},{"attributes":{"fill_alpha":0.1,"fill_color":"saddlebrown","hatch_alpha":{"value":0.1},"x":{"field":"x"},"y1":{"value":0},"y2":{"field":"z"}},"id":"64766","type":"VArea"},{"attributes":{"text":"&lt;h1&gt;Channel (turbulent) flow: Manning's equation&lt;/h1&gt;\n        &lt;meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\"&gt;\n        &lt;p style=\"color:red; font-size: 150%\"&gt;Under construction&lt;/p&gt;\n        &lt;p&gt;This example considers flow in a channel with a rectangular cross-section and estimates the flow depth for a given flow rate. \n        The user can also control the channel width, slope and surface roughness.&lt;/p&gt;\n        "},"id":"64973","type":"Div"},{"attributes":{},"id":"63918","type":"DataRange1d"},{"attributes":{"height":5,"style":{"font-size":"80%"},"text":"&lt;p&gt;&lt;img src=\"images/copyright-symbol.png\" alt=\"Copyright\" width=\"10\"&gt; 2022, Dr Nick Cartwright, Griffith University&lt;/p&gt;"},"id":"64976","type":"Div"},{"attributes":{"line_alpha":0.2,"line_color":"#1f77b4","x":{"field":"H"},"y":{"field":"O"}},"id":"65199","type":"Line"},{"attributes":{"children":[{"id":"64978"},{"id":"64837"},{"id":"64838"},{"id":"64840"},{"id":"64839"},{"id":"64841"},{"id":"64971"},{"id":"64975"},{"id":"64846"}]},"id":"64979","type":"Column"},{"attributes":{"coordinates":null,"data_source":{"id":"64730"},"glyph":{"id":"64759"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"64761"},"nonselection_glyph":{"id":"64760"},"view":{"id":"64763"}},"id":"64762","type":"GlyphRenderer"},{"attributes":{"text":"&lt;h1&gt;Potential Evaporation Rates&lt;/h1&gt;\n        &lt;p&gt;This applet estimates the &lt;u&gt;&lt;b&gt;potential&lt;/b&gt;&lt;/u&gt; evaporation rate which is the maximum possible rate for a given set of atmospheric condditions &lt;i&gt;&lt;b&gt;assuming that the supply of water is not a limiting factor&lt;/b&gt;&lt;/i&gt; (e.g. that which is observed over an ocean or lake). \n        &lt;/p&gt;\n                   "},"id":"64128","type":"Div"},{"attributes":{"line_alpha":0.2,"line_color":"saddlebrown","line_width":2,"x":{"field":"x"},"y":{"field":"z"}},"id":"64761","type":"Line"},{"attributes":{"fill_alpha":{"value":0.1},"fill_color":{"value":"yellow"},"hatch_alpha":{"value":0.1},"line_alpha":{"value":0.1},"marker":{"value":"circle_dot"},"size":{"value":10},"x":{"field":"Hpt"},"y":{"field":"Opt"}},"id":"65210","type":"Scatter"},{"attributes":{},"id":"63922","type":"LinearScale"},{"attributes":{"children":[{"id":"64850"},{"id":"64917"}]},"id":"64980","type":"Column"},{"attributes":{"overlay":{"id":"63936"}},"id":"63932","type":"BoxSelectTool"},{"attributes":{"coordinates":null,"data_source":{"id":"64730"},"glyph":{"id":"64765"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"64767"},"nonselection_glyph":{"id":"64766"},"view":{"id":"64769"}},"id":"64768","type":"GlyphRenderer"},{"attributes":{"line_color":"#1f77b4","x":{"field":"H"},"y":{"field":"O"}},"id":"65197","type":"Line"},{"attributes":{"children":[{"id":"64973"},{"id":"64981"},{"id":"64974"},{"id":"64976"}]},"id":"64982","type":"Column"},{"attributes":{},"id":"63935","type":"ResetTool"},{"attributes":{"children":[{"id":"64979"},{"id":"64980"}],"height":680},"id":"64981","type":"Row"},{"attributes":{"index":2,"label":{"value":"Ec"},"renderers":[{"id":"63949"}]},"id":"63959","type":"LegendItem"},{"attributes":{"line_color":"red","x":{"field":"xProfile"},"y":{"field":"Ec"}},"id":"63948","type":"Line"},{"attributes":{"line_color":"green","line_width":2,"x":{"field":"t"},"y":{"field":"I"}},"id":"65036","type":"Line"},{"attributes":{"tools":[{"id":"65025"},{"id":"65026"},{"id":"65027"},{"id":"65028"},{"id":"65140"}]},"id":"65030","type":"Toolbar"},{"attributes":{"data":{"Ea":{"__ndarray__":"gMatV6D3SEDvqynsO/FIQF6RpYDX6khAzXYhFXPkSEA7XJ2pDt5IQKhBG es":{},"id":"65028","type":"ResetTool"},{"attributes":{"source":{"id":"64730"}},"id":"64763","type":"CDSView"},{"attributes":{"data":{"color":["blue","green","red"],"index":[0,1,2],"xPoint":[10,10,10],"yPoint":{"__ndarray__":"T1yAyxRGGkA+aG38CXk2QPBR1m9ecCRA","dtype":"float64","order":"little","shape":[3]}},"selected":{"id":"65581"},"selection_policy":{"id":"65580"}},"id":"64072","type":"ColumnDataSource"},{"attributes":{},"id":"65026","type":"PanTool"},{"attributes":{},"id":"65365","type":"StringEditor"},{"attributes":{"axis":{"id":"65021"},"coordinates":null,"dimension":1,"group":null,"ticker":null},"id":"65024","type":"Grid"},{"attributes":{"fill_color":{"value":"yellow"},"marker":{"value":"circle_dot"},"size":{"value":10},"x":{"field":"Hpt"},"y":{"field":"Opt"}},"id":"65209","type":"Scatter"},{"attributes":{"coordinates":null,"data_source":{"id":"63913"},"glyph":{"id":"63952"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"63954"},"nonselection_glyph":{"id":"63953"},"view":{"id":"63956"}},"id":"63955","type":"GlyphRenderer"},{"attributes":{"fill_alpha":0.5,"fill_color":"saddlebrown","x":{"field":"x"},"y1":{"value":0},"y2":{"field":"z"}},"id":"64765","type":"VArea"},{"attributes":{},"id":"63929","type":"BasicTicker"},{"attributes":{},"id":"65022","type":"BasicTicker"},{"attributes":{},"id":"65366","type":"StringEditor"},{"attributes":{},"id":"65018","type":"BasicTicker"},{"attributes":{"fill_alpha":{"value":0.2},"fill_color":{"value":"#1f77b4"},"hatch_alpha":{"value":0.2},"line_alpha":{"value":0.2},"line_color":{"value":"#1f77b4"},"x":{"field":"H"},"y":{"field":"O"}},"id":"65205","type":"Circle"},{"attributes":{},"id":"65009","type":"DataRange1d"},{"attributes":{},"id":"65367","type":"StringEditor"},{"attributes":{"axis":{"id":"65017"},"coordinates":null,"group":null,"ticker":null},"id":"65020","type":"Grid"},{"attributes":{"source":{"id":"63913"}},"id":"63956","type":"CDSView"},{"attributes":{"tools":[{"id":"65186"},{"id":"65187"},{"id":"65188"},{"id":"65189"},{"id":"65229"}]},"id":"65191","type":"Toolbar"},{"attributes":{},"id":"65223","type":"Selection"},{"attributes":{"coordinates":null,"data_source":{"id":"64991"},"glyph":{"id":"65203"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"65205"},"name":"hover","nonselection_glyph":{"id":"65204"},"view":{"id":"65207"}},"id":"65206","type":"GlyphRenderer"},{"attributes":{"text":"\n        &lt;h2&gt;Background&lt;/h2&gt;\n       \n        &lt;p&gt;The main factors limiting evaporation are:&lt;/p&gt;\n            &lt;ol&gt;\n                &lt;li&gt;&lt;b&gt;Solar radiation:&lt;/b&gt; the supply of heat energy required to satisfy the latent heat of vapourisation&lt;/li&gt;\n                &lt;li&gt;&lt;b&gt;Vapour transport:&lt;/b&gt; the ability to transport water vapour away from the evaporative surface which depends on:\n                    &lt;ol type=\"a\"&gt;\n                        &lt;li&gt;the temperature/degree of saturation of the air mass (which defines the capacity of the air mass to take on more vapour)&lt;/li&gt;\n                        &lt;li&gt;advection of vapour away from the evaporating surface by wind which maintains a saturation deficit in the overlying air&lt;/li&gt;\n                    &lt;/ol&gt;\n                &lt;/li&gt;\n                &lt;li&gt;&lt;b&gt;Water supply:&lt;/b&gt; the availability of water at the evaporative surface (e.g. oceans versus dry desert).&lt;/li&gt;\n            &lt;/ol&gt;\n        &lt;p&gt;The &lt;u&gt;&lt;b&gt;potential&lt;/b&gt;&lt;/u&gt; evaporation rate is the maximum possible rate for a given set of atmospheric condditions &lt;i&gt;&lt;b&gt;assuming that the supply of water is not a limiting factor&lt;/b&gt;&lt;/i&gt; (e.g. that which is observed over an ocean or lake). \n        &lt;/p&gt;\n\n        &lt;h3&gt;Energy balance method&lt;/h3&gt;\n\n        &lt;p&gt;The &lt;u&gt;&lt;b&gt;Energy Balance&lt;/b&gt;&lt;/u&gt; method assumes that vapour transport doesn't limit evaporation and quantifies energy supply as the limiting factor, &lt;br&gt;\n            $$\\quad E_r = \\frac{R_n}{\\rho_w l_v} \\quad \\left(m/s\\right)$$ &lt;br&gt;\n            where $$R_n$$ is the net colar radiation $$\\left(W/m^2\\right)$$, $$\\rho_w$$ is the density of water $$\\left(kg/m^3\\right)$$ and $$l_v$$ is the latent heat of vapourisation (J/kg) given by, &lt;br&gt;\n            $$\\quad l_v = 2.501 \\times 10^{-6} T$$ where $$T$$ is the temperature $$\\left(^\\circ C\\right)$$.\n        &lt;/p&gt;\n\n        &lt;h3&gt;Aerodynamic (vapour transport) method&lt;/h3&gt;\n\n        &lt;p&gt;The &lt;u&gt;&lt;b&gt;Aerodynamic&lt;/b&gt;&lt;/u&gt; method assumes that enery supply does not limit evaporation and quantifies vapour transport as the limiting factor, &lt;br&gt;\n            $$\\quad E_a = \\left(\\frac{\\rho_{vs}}{\\rho_w}\\right)\\left(\\frac{u_*}{u}\\right)^2\\left(1-R_h\\right) \\quad \\left(m/s\\right)$$ &lt;br&gt;\n             where $$\\rho_{vs}$$ is the saturation vapour density $$\\left(kg/m^3\\right)$$, $$R_h$$ is the relative humidity, $$u$$ is the wind speed $$\\left(m/s\\right)$$ and $$u^*$$ is the friction velocity $$\\left(m/s\\right)$$ which is found from the log-law, &lt;br&gt;\n             $$\\quad \\frac{u^*}{u}=\\frac{\\kappa}{ln\\left(\\frac{z}{z_0}\\right)} $$ &lt;br&gt;\n             where $$\\kappa = 0.4$$ is von Karmen's constant, $$z$$ is the height above the evaporating surface where the wind speed $$u$$ is measured and $$z_0$$ is the surface roughness height.\n        &lt;/p&gt;\n        \n\n        &lt;h3&gt;Combined method&lt;/h3&gt;\n\n        &lt;p&gt;The &lt;u&gt;&lt;b&gt;Combined&lt;/b&gt;&lt;/u&gt; method is a weighted average of the Energy Balanace and Aerodynamic methods taking into account the two limiting factors energy supply and vapour transport and is given by, &lt;br&gt;\n            $$\\quad E_c = \\left(\\frac{\\Delta}{\\Delta+\\gamma}\\right)E_r + \\left(\\frac{\\gamma}{\\Delta+\\gamma}\\right)E_a \\quad \\left(m/s\\right) $$ &lt;br&gt;\n                where $$\\Delta$$ is the slope of the saturation vapour pressure curve $$\\left(Pa/^\\circ C\\right)$$ given by,&lt;br&gt;\n                $$\\quad \\Delta=\\frac{de_s}{dT}=\\frac{4098e_s}{\\left(237.3+T\\right)^2} \\quad \\left(Pa/^\\circ C\\right)$$ &lt;br&gt;\n                $$T$$ is the air temperature $$\\left(^\\circ C\\right)$$ and $$e_s$$ is the saturation vapour pressure $$\\left(Pa\\right)$$. $$\\gamma$$ is is the psychrometric constant given by,&lt;br&gt;\n                $$\\quad \\gamma = \\frac{C_pp}{0.622l_v} \\approx 67 \\textrm{Pa/}^\\circ\\textrm{C} $$ &lt;br&gt;\n                where $$p$$ is the atmospheric pressure $$\\left(Pa\\right)$$, $$C_p$$ is the  specific heat of air $$\\left(\\approx 1005J/kg/^\\circ K\\right)$$.&lt;br&gt;\n                Note that, &lt;br&gt;\n                $$\\quad \\left(\\frac{\\Delta}{\\Delta+\\gamma}\\right) + \\left(\\frac{\\gamma}{\\Delta+\\gamma}\\right)  = 1 $$\n\n        &lt;/p&gt;\n                         "},"id":"64129","type":"Div"},{"attributes":{},"id":"65011","type":"DataRange1d"},{"attributes":{"coordinates":null,"group":null},"id":"64782","type":"Title"},{"attributes":{},"id":"65044","type":"BasicTickFormatter"},{"attributes":{"overlay":{"id":"64095"}},"id":"64091","type":"BoxSelectTool"},{"attributes":{"coordinates":null,"data_source":{"id":"64416"},"glyph":{"id":"64472"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"64474"},"nonselection_glyph":{"id":"64473"},"view":{"id":"64476"}},"id":"64475","type":"GlyphRenderer"},{"attributes":{"fill_alpha":{"value":0.1},"fill_color":{"value":"yellow"},"hatch_alpha":{"value":0.1},"line_alpha":{"value":0.1},"marker":{"value":"circle_dot"},"size":{"value":10},"x":{"field":"tPoint"},"y":{"field":"yPoints"}},"id":"65145","type":"Scatter"},{"attributes":{"source":{"id":"64416"}},"id":"64476","type":"CDSView"},{"attributes":{"height":5,"style":{"font-size":"80%"},"text":"&lt;p&gt;&lt;img src=\"images/copyright-symbol.png\" alt=\"Co
